// read file (keyfile)
func Genkf(path string) []byte {
	f, err := kio.Open(path, "r")
	if err != nil {
		return nil
	} else {
		defer f.Close()
	}
	data, err := kio.Read(f, -1)
	if err == nil {
		return data
	} else {
		return nil
	}
}

// crc32 (nB -> 4B)
func hash32(data []byte) []byte {
	temp := crc32.ChecksumIEEE(data)
	out := make([]byte, 4)
	for i := range out {
		out[i] = byte(temp % 256)
		temp = temp / 256
	}
	return out
}

// md5-128 (nB -> 16B)
func hash128(data []byte) []byte {
	temp := md5.Sum(data)
	return temp[:]
}

// sha2-256 (nB -> 32B)
func hash256(data []byte) []byte {
	temp := sha256.Sum256(data)
	return temp[:]
}

// sha3-512 (nB -> 64B)
func hash512(data []byte) []byte {
	temp := sha3.New512()
	temp.Write(data)
	return temp.Sum(nil)
}

// scrypt (nB -> mB)
func hashscrypt(pw []byte, salt []byte, round int, word int, core int, length int) []byte {
	temp, _ := scrypt.Key(pw, salt, round, word, core, length)
	return temp
}

// aes-256 encrypt chunk (16nB, no pad)
func aes16en(data []byte, key []byte, iv []byte) []byte {
	if len(data)%16 != 0 || len(key) != 32 || len(iv) != 16 {
		return nil
	}
	temp := make([]byte, len(data))
	block, _ := aes.NewCipher(key)
	encrypter := cipher.NewCBCEncrypter(block, iv)
	encrypter.CryptBlocks(temp, data)
	copy(iv, temp[len(temp)-16:])
	return temp
}

// aes-256 decrypt chunk (16nB, no pad)
func aes16de(data []byte, key []byte, iv []byte) []byte {
	if len(data)%16 != 0 || len(key) != 32 || len(iv) != 16 {
		return nil
	}
	temp := make([]byte, len(data))
	block, _ := aes.NewCipher(key)
	decrypter := cipher.NewCBCDecrypter(block, iv)
	decrypter.CryptBlocks(temp, data)
	copy(iv, data[len(data)-16:])
	return temp
}

// aes-256 encrypt end (nB, do pad)
func aes1en(data []byte, key []byte, iv []byte) []byte {
	plen := byte(16 - len(data)%16)
	var i byte
	for i = 0; i < plen; i++ {
		data = append(data, plen)
	}
	return aes16en(data, key, iv)
}

// aes-256 decrypt end (16nB, do pad)
func aes1de(data []byte, key []byte, iv []byte) []byte {
	temp := aes16de(data, key, iv)
	if temp == nil {
		return nil
	} else {
		plen := temp[len(temp)-1]
		return temp[0 : len(temp)-int(plen)]
	}
}

// generate true random nB
func genrand(n int) []byte {
	temp := make([]byte, n)
	rand.Read(temp)
	return temp
}

// base64 encodeing kstyle
func kb64en(data []byte) string {
	temp := base64.StdEncoding.EncodeToString(data)
	temp = strings.Replace(temp, "+", "$", -1)
	temp = strings.Replace(temp, "/", "%", -1)
	temp = strings.Replace(temp, "=", "&", -1)
	return temp
}

// base64 decodeing kstyle
func kb64de(data string) []byte {
	data = strings.Replace(data, "$", "+", -1)
	data = strings.Replace(data, "%", "/", -1)
	data = strings.Replace(data, "&", "=", -1)
	temp, _ := base64.StdEncoding.DecodeString(data)
	return temp
}

// png <-> bmp lossless conversion
func pconv(path string, del bool) {
	if del {
		defer os.Remove(path)
	}
	path = kio.Abs(path)
	ext := strings.ToLower(path[len(path)-3:])
	f, _ := kio.Open(path, "r")
	defer f.Close()

	switch ext {
	case "png":
		img, _ := png.Decode(f)
		t, _ := kio.Open(path[0:len(path)-3]+"bmp", "w")
		defer t.Close()
		bmp.Encode(t, img)
	case "bmp":
		img, _ := bmp.Decode(f)
		t, _ := kio.Open(path[0:len(path)-3]+"png", "w")
		defer t.Close()
		png.Encode(t, img)
	}
}

// img resize
func presize(img *image.Image, row int, col int) *image.Image {
	temp := resize.Resize(uint(row), uint(col), *img, resize.Lanczos3)
	return &temp
}
